  vR[i] = _SET(0, pts[src]->X[1][i], 0, pts[src]->X[0][i], 0, pts[src]->Z[1][i], 0, pts[src]->Z[0][i]);
  get_4_isog_1x2x2x2w(vR, C24_A24plus[col+1], coeff__0[col], coeff2_1[col]);
  get_channel_4x2w(cf0[0][col], coeff__0[col], 0);
  get_channel_4x2w(cf0[1][col], coeff__0[col], 2);
  get_channel_4x2w(cf1[0][col], coeff2_1[col], 0);
  get_channel_4x2w(cf1[1][col], coeff2_1[col], 2);
  get_channel_4x2w(cf2[0][col], coeff2_1[col], 4);
  get_channel_4x2w(cf2[1][col], coeff2_1[col], 6);
