  // note that phiP, phiQ, phiR are now in radix-2^51 Montgomery domain (montR = 2^765)

  // 1. convert to radix-2^64
  mpi_conv_51to64(phiP64->X[0], pts[3995]->X[0], NWORDS_FIELD, VNWORDS);
  mpi_conv_51to64(phiP64->X[1], pts[3995]->X[1], NWORDS_FIELD, VNWORDS);
  mpi_conv_51to64(phiP64->Z[0], pts[3995]->Z[0], NWORDS_FIELD, VNWORDS);
  mpi_conv_51to64(phiP64->Z[1], pts[3995]->Z[1], NWORDS_FIELD, VNWORDS);
